private void  (HttpServerExchange exchange StringBuilder sb){ try { FormData formData=exchange.getAttachment(FormDataParser.FORM_DATA); if (formData != null) { sb.append("body=
"); for ( String formField : formData) { Deque<FormData.FormValue> formValues=formData.get(formField); sb.append(formField).append("="); for ( FormData.FormValue formValue : formValues) { sb.append(formValue.isFile() ? "[file-content]" : formValue.getValue()); sb.append("
"); if (formValue.getHeaders() != null) { sb.append("headers=
"); for ( HeaderValues header : formValue.getHeaders()) { sb.append("	").append(header.getHeaderName()).append("=").append(header.getFirst()).append("
"); } } } } } } catch ( Exception e) { throw new RuntimeException(e); } }

